import React, { Fragment } from "react";
import { Link } from "react-router-dom";

export default function Leftbar() {
  const leftSidebarContent = [
    {
      title: "Questions",
      link: "/questions",
    },
    {
      title: "Tags",
      link: "/tags",
    },
    {
      title: "Users",
      link: "/users",
    },
    {
      title: "Companies",
      link: "/companies",
    },
  ];
  return (
    <React.Fragment>
      <div className="h-screen bg-zinc-700 w-2/12 hidden sm:block border-r-2 border-gray-8600">
        <Link to="/" className="relative top-4 text-left py-1 px-2 text-sm text-white w-full active:bg-gray-700 active:border-r-4 active:font-bold border-cyan-600">
          Home
        </Link>

        <div className="">
          <p className="relative top-8 text-left px-2 text-white uppercase text-xs">
            Public
          </p>
          <ul className="text-left relative top-8 w-full">
            {leftSidebarContent.map((item, index) => (
              <li
                key={index}
                className="w-full  active:bg-gray-700 active:border-r-4 active:font-bold border-cyan-600 py-1 px-4"
              >
                <Link className="text-sm hover:text-white text-gray-300" to={item.link}>
                  {item.title}
                </Link>
              </li>
            ))}
          </ul>
        </div>
      </div>
    </React.Fragment>
  );
}
